import React from 'react';

function Profile() {
  return (
    <div className="header__profile">
      <img className="header__profile__image" src="/assets/Photo.png" alt="Foto Perfil" />
      <span className="header__profile__name">Mateus</span>
    </div>
  )
}

export default Profile
